import React,{useState,useEffect} from 'react';



function Main() {
	const [moviedata,setMoviedata]=useState([]);
	useEffect(() => {
    fetch("https://api.themoviedb.org/3/movie/upcoming?api_key=a0d1ccffb7077d4acb8d946b535565ac&language=en-US&page=1")
    .then(response => response.json())

    .then(data => setMoviedata(data))
	console.log(moviedata);
  });

  return (
  <>
<div className="container">
	{moviedata && moviedata.map((mdata=>{
	return(
	<>
		 <div classNameName="card" >
			  <img className="card-img-top" src="mdata.poster_path" alt="not loading"/>
			  <div className="card-body">
				  <h5 className="card-title">mdata.original_title</h5>
				  <h4 className="card-text">mdata.vote_average</h4>
				  <p className="card-text">mdata.overview </p>
			  </div>
		 </div>
	</> 
		 );
	}))}
</div>
 </>
  );
}

export default Main;
